import Link from "next/link";

const Result = (props) => {
  const { resultName } = props;

  return (
    <>
      <div>{resultName}</div>
      <img
        alt="monster"
        src={`https://robohash.org/some?set=set4&size=180x180`}
      />
      <Link href="/">
        <a>Try Again</a>
      </Link>
    </>
  );
};
export default Result;
